import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Find and click a product card to open the modal
    // Using a selector that targets a product card containing specific text for robustness
    const productCardLocator = page.locator('.product-card', { hasText: 'Sony WH-1000XM5' });
    await productCardLocator.waitFor({ state: 'visible', timeout: 5000 });
    await productCardLocator.click();

    // Wait for the modal to be visible
    const modalLocator = page.locator('#productModal[style*="display: block"]');
    await modalLocator.waitFor({ state: 'visible', timeout: 5000 });

    // Take a screenshot with the modal open
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_modal_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_modal_open.png'));

    // Extract data from the modal to verify
    const modalTitle = await page.locator('.product-detail-title').textContent();
    const modalPrice = await page.locator('.product-detail-price').textContent();

    const isModalVisible = await modalLocator.isVisible();

    if (!isModalVisible) {
      throw new Error('Product detail modal did not open after clicking the product card.');
    }

    return {
      success: true,
      action: "Opened the product detail modal by clicking on a product card.",
      extractedData: {
        modalTitle: modalTitle.trim(),
        modalPrice: modalPrice.trim(),
        isModalVisible
      },
      screenshots,
      error: null
    };
  } catch (error) {
    // Take a screenshot on failure
    const errorScreenshotPath = path.join(screenshotsDir, 'error_screenshot.png');
    await page.screenshot({ path: errorScreenshotPath });

    return {
      success: false,
      action: "Failed to open product detail modal",
      extractedData: {},
      screenshots: [errorScreenshotPath],
      error: error.message
    };
  }
}
